import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div class="container">
	<div class="notebook">
		<div class="cover"></div>
		<div class="page one">
			<p>Made with: <br/>Pure CSS</p>
		</div>
		<div class="page two"></div>
		<div class="page three"></div>
	</div>
</div>
  );
}

export default App;
